    data: |
      SELECT DISTINCT - CAST ( 63 AS REAL ) AS col0 FROM tab2, tab1 AS cor0, tab1 AS cor1, tab0, tab1 AS cor2;
  - name: tab0
  - name: tab1
  - name: tab2

outputs:
  - name: q5123.out
    data: |
      -63
